import Navbar from './Navbar'
import Home from './Home'
import { BrowserRouter as Router, Route, Swi } from 'react-router-dom';
function App() {
  const title = "Alex's Project"
  return (
    <Router>

    <div className="App">
      <Navbar />
      <div className="content">
        <Routes>
          <Route path="/">
          <Home/>
          </Route>
      </Routes>
      </div>
    </div>
    </Router>
  );
}

export default App;
